import request from '@/utils/request';
import { host, qiniuHost } from "./utils";
export function getToken() {
  return request({
    url: host + '/api/getToken',
    method: 'get'
  });
}
export function uploadFile(data) {
  return request({
    url: qiniuHost,
    method: 'post',
    data: data,
    headers: {
      'Content-Type': 'multipart/form-data'
    }
  });
}
export function uploadBase64(base64, length, upToken) {
  return request({
    url: qiniuHost + '/putb64/' + length,
    method: 'post',
    data: base64,
    headers: {
      'Content-Type': 'application/octet-stream',
      'Authorization': 'UpToken ' + upToken
    }
  });
}
export function deleteFile(params) {
  return request({
    url: host + '/api/deleteFile',
    method: 'get',
    params: params
  });
}
export function deleteFiles(params) {
  return request({
    url: host + '/api/deleteFiles',
    method: 'get',
    params: params
  });
}
